import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import {
    Grid,
    Typography,
} from '@material-ui/core';

import ReactLogo from './imgs/React.png';
import MaterialUI from './imgs/MaterialUI.png';

const useStyles = makeStyles((theme) => ({
    tech: {
        padding: 20,
        backgroundColor: 'white',
        display: 'flex',
        alignItems: 'center',
        alignContent: 'center',
        justifyContent: 'center',
        flexWrap: 'wrap',
    },
    header: {
        marginBottom: 30,
        color: '#0000a2',
        fontFamily: 'Avenir Medium',
    },
    techText: {
        color: '#0000a2',
    },
    imgs: {
        width: '40%',
        height: 'auto',
    },
}));

const Home = () => {

    const classes = useStyles();

    return (
        <Grid className={classes.tech} item xs={12}>

            <Typography
                className={classes.header}
                variant="h6"
                align="center"
            >
                We develop web, mobile and software applications 
                that allow our customers to gain market share
            </Typography>

            <Typography
                className={classes.techText}
                variant="body1"
                align="center"
            >
                The most used front-end frameworks are React and Material-UI
            </Typography>

            <img
                className={classes.imgs}
                src={ReactLogo}
                alt="React JS logo"
            />

            <img
                className={classes.imgs}
                src={MaterialUI}
                alt="Material UI logo"
            />

        </Grid>
    );
};

export default Home;
